import { Avatar, Card } from 'antd';

const UserProfile = () => {
    return(
        <Card
            actions={[
                <div key="writeNum">적은 글 수 <br />0</div>,
                <div key="following">팔로잉<br />0</div>,
                <div key="followers">팔로워<br />0</div>
            ]}
        >
            <Card.Meta>
                avatar={<Avatar>MSG</Avatar>}
                title="test"
            </Card.Meta>
        </Card>
    )
}

export default UserProfile;
